import React from 'react'

const MainNavigation = () => {
    const MENU = [
        {
            name: "Contact Us",
            path: "/contact-us",
        },
        {
            name: "FAQ",
            path: "/faqs",
        },
        {
            name: "Gallery",
            path: "/gallery",
        },
    ];
  return (
    <ul>
        { MENU.map( (menuItem) => {
            return (
                <li>
                    <Link to={menuItem.path} ></Link>
                </li>
            )
        })}
    </ul>
  )
}

export default MainNavigation
